const Form = () => {
    return(
        <div className={style.form}>
            <label htmlFor="email">Email: </label>
            <input type="text" className={style.input}/>
            <hr />
            <label htmlFor="password">Password:</label>
            <input type="text" className={style.input}/>
            <hr />
            <button className={style.button}>LOGIN</button>
        </div>
    )
}
export default Form;
